import { Box, Button, TextField, Typography } from "@mui/material";
import MyButton from "./MyButton";

const OrderListFirst = ({ setPageNumber }) => {
  return (
    <Box>
      <Box display="flex" alignItems="center">
        <Typography mx={2}>출발지</Typography>
        <TextField
          fullWidth
          margin="normal"
          id="origin"
          name="origin"
          autoFocus
        />
      </Box>
      <Box display="flex" alignItems="center">
        <Typography mx={2}>도착지</Typography>
        <TextField
          fullWidth
          margin="normal"
          id="destination"
          name="destination"
          autoFocus
        />
      </Box>
      <Box
        width="300px"
        display="flex"
        alignItems="center"
        justifyContent="space-between"
      >
        <MyButton
          type="negative"
          value="뒤로가기"
          onClick={() => {
            setPageNumber(1);
          }}
          sx={{ width: "100px", height: "50px" }}
        />
        <MyButton
          value="다음"
          onClick={() => {
            setPageNumber(2);
          }}
          sx={{ width: "100px", height: "50px" }}
        />
      </Box>
    </Box>
  );
};

export default OrderListFirst;
